import './App.css';
import './Navbar.css'
import Navbar from './components/Navbar';
import Router from "./components/Router"

function App() {
  return (
    <>
    <Router><Navbar></Navbar></Router>

    <div >
        <a className="select_host" href="/host">
          Host
        </a>
        <a className="select_join" href="/join">
          Join
        </a>
      </div>
    
    
    </>
  );
}

export default App;
